import React, { useState, useRef } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [books, setBooks] = useState([{title: "test", author: "abc"}]);
  const ref = useRef();
  return (
    <div className="App">
      {
        books.map(book => {
          return (
            <div>
              <div>{book.title}</div>
              <div>{book.author}</div>
            </div>
          );
        })
      }
    </div>
  );
}

export default App;
